class pageSignIn extends Component {
  state = {};
  render() {
    return (
      <div>
        <TopNavIntro></TopNavIntro>
        <p>signin</p>
        <BottomNav></BottomNav>
      </div>
    );
  }
}

export default pageSignIn;
